import React from 'react';
import HomeProductCard from '../components/Home/HomeProductCard'
import HomeCategoryCard from '../components/Home/HomeCategoryCard'
import { Col, Row, CardBody,Card,CardTitle,ListGroup,ListGroupItem } from 'reactstrap';

function Home() {
  return (
    <div>
      <Row>
        <Col>
          <HomeProductCard/>
        </Col>
        <Col>
          <Card
            style={{
              width: '18rem'
            }}
          >
            <CardBody>
              <CardTitle tag="h5">
                Kategoriler
              </CardTitle>
            </CardBody>
            <ListGroup flush>
              <ListGroupItem>
                An item
              </ListGroupItem>
            </ListGroup>
          </Card>
        </Col>
      </Row>
    </div>
  );
}

export default Home;
